import { configureStore } from '@reduxjs/toolkit';
import loginReducer from './storeLogin'; // Import your loginReducer

const store = configureStore({
  reducer: {
    login: loginReducer, // Assuming loginReducer is correctly defined in storeLogin.js
    // Add other reducers as needed
  },
});

export default store;
